**Word Counter Program in C++**
================================

This program reads a text file line by line and counts the number of occurrences of a specific word.

### Code

```cpp
#include <iostream>
#include <fstream>
#include <sstream>
#include <string>

// Function to count word occurrences in a file
int countWordOccurrences(const std::string& filename, const std::string& targetWord) {
    int count = 0;
    std::ifstream file(filename);

    if (file.is_open()) {
        std::string line;
        while (std::getline(file, line)) {
            std::istringstream iss(line);
            std::string word;

            // Convert to lowercase for case-insensitive comparison
            std::string lowerTargetWord = targetWord;
            for (char& c : lowerTargetWord) {
                c = std::tolower(c);
            }

            while (iss >> word) {
                // Convert to lowercase for case-insensitive comparison
                std::string lowerWord = word;
                for (char& c : lowerWord) {
                    c = std::tolower(c);
                }

                if (lowerWord == lowerTargetWord) {
                    count++;
                }
            }
        }
        file.close();
    }

    return count;
}

int main() {
    const std::string filename = "example.txt";
    const std::string targetWord = "example";

    int occurrences = countWordOccurrences(filename, targetWord);

    std::cout << "The word '" << targetWord << "' occurs " << occurrences << " times in " << filename << "." << std::endl;

    return 0;
}
```

### Explanation

1. **Header Inclusions**: Include necessary headers for file input/output (`<fstream>`), string manipulation (`<sstream>`), and input/output (`<iostream>`).
2. **`countWordOccurrences` Function**:
   - Opens the specified file for reading.
   - Iterates over each line in the file.
   - For each line, splits it into individual words using a string stream.
   - Compares each word (in lowercase) with the target word (also in lowercase) for case-insensitive matching.
   - Increments the count for each match.
3. **`main` Function**:
   - Specifies the input file and target word.
   - Calls `countWordOccurrences` to get the word count.
   - Prints the result.

### Example Use Case

*   Create a text file named `example.txt` with the following content:

    ```
Hello example world.
This is another example sentence.
Example is a common word.
```

*   Run the program. The output will be:

    ```
The word 'example' occurs 3 times in example.txt.
```

This program efficiently counts the occurrences of a specific word in a text file, making it useful for various text analysis tasks.
